import React, { Component } from 'react';
import styles from './workpage.module.scss';
class WorkPage extends Component {
    render(){
        return <div className={styles.wrap}>
            <div className={styles.left}>
                <img src="" alt=""></img>
                <h4>Title</h4>
                <p>Junior Web Developer</p>
                <h4>Location</h4>
                <p>Sydney, Australia</p>
                <h4>Email</h4>   
                <p>Sydney, Australia</p>
            </div>
            <div className={styles.right}>
               <h3>DESCRIPTION</h3>
               <p>Actively seeking internship or junior position jobs for web developer . I am a faster learner with strong self-learning ability and communication skills . I am also good at front-end development to design web pages.</p>
            </div>

       </div> 
  }
  }

  export default WorkPage;
